import React from "react";
import "./App.css";
import GetStarted from "./pages/GetStarted";
import { Routes, Route, Link, NavLink, redirect } from "react-router-dom";
import GSLangContext, {
  getStartedPageLang,
} from "./contexts/GetStartedLangContext";

function App() {
  return (
    <GSLangContext.Provider value={getStartedPageLang}>
      <Routes>
        <Route path="/nl-en" element={<GetStarted />} />
      </Routes>
    </GSLangContext.Provider>
  );
}

export default App;
